.work{
	max-width: 1512px;
	height: auto;
	margin: 0 auto;
	display: flex;
	flex-wrap: wrap;
	justify-content: center;
	gap: 2px;
	position: relative;
	@media screen and (min-width: 320px) and (max-width: 480px){

	}
}

.block1{
	width: 375px;
	height: 340px;
	position: relative;
	@media screen and (min-width: 481px) and (max-width: 1506px){
		width: 250px;
		height: 230px;
	}
	@media screen and (min-width: 320px) and (max-width: 480px){
		width: 158px;
		height: 144px;
	}
}
.block1 img{
	width: 375px;
	height: 340px;
	@media screen and (min-width: 481px) and (max-width: 1506px){
		width: 250px;
		height: 230px;
	}
	@media screen and (min-width: 320px) and (max-width: 480px){
		width: 158px;
		height: 144px;
	}
}
.hover1{
	position: absolute;
	display: none;
	width: 100%;
	height: 100%;
	top: 0;
	right: 0;
	bottom: 0;
	left: 0;
	z-index: 2;

}
.block1:hover .hover1 {
	display: flex;
	flex-direction: column;
	justify-content: center;
	background-color: rgba(255,0,0, .4);
	animation: zoomIn 1s;
}
.block1:active .hover1{
	display: flex;
	flex-direction: column;
	justify-content: center;
	background-color: rgba(255,0,0, .8);
	

}
.zoomIn {
	-webkit-animation-name: zoomIn;
	animation-name: zoomIn;
	-webkit-animation-duration: 1s;
	animation-duration: 1s;
	-webkit-animation-fill-mode: both;
	animation-fill-mode: both;
	}
	@-webkit-keyframes zoomIn {
	0% {
	opacity: 0;
	-webkit-transform: scale3d(.3, .3, .3);
	transform: scale3d(.3, .3, .3);
	}
	50% {
	opacity: 1;
	}
	}
	@keyframes zoomIn {
	0% {
	opacity: 0;
	-webkit-transform: scale3d(.3, .3, .3);
	transform: scale3d(.3, .3, .3);
	}
	50% {
	opacity: 1;
	}
	}
